import React from "react";
import Emoji from "./Emoji";
import emojipedia from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia1</span>
      </h1>
      <Emoji 
        emoji = {emojipedia.emoji}
        name = {emojipedia.name}
        maining = {emojipedia.maining}
      />


    </div>
  );
}

export default App;
